import React, {useState} from 'react';
import Modals from "../components/modals";

const RegisterPages: React.FC = () => {
    const [msg, setMsg] = useState<string>('');

    return (
        <div>
            <Modals isOpen = {true} msg={msg}/>
        </div>
    );
};

export default RegisterPages;
